      <div class="col-12 col-md-6 col-lg-4 col-xl-3 productCard">
        <p>{picture}</p>
        <a class="productLink" href={""}>
          <img src={`/photos_good/portrait/${picture}`} class="card-img-top indexProductImage" alt="..."/>
        </a>
      </div>
    ));
  }

  return (
    <div class="row">
      {mapProductsToItems(portrait)}
    </div>
  );

}
